class Meditationex extends Component {
  render() {
      return (
       <div style={{backgroundColor:"#d9d2d9", height:"30vh"}}>       <div className= 'float center text-center pb-4 text-color'>
        <h2 style={{color:"black"}} ><u><i>Transform your life</i></u></h2>
