        </div>
       <div style={{backgroundColor:"#EBC9BC" ,height:"82vh"}}className= 'row pt-5'>
         
       <div onclick="location.href='./Meditation';" style="cursor: pointer;" className=' col ' style={{ marginLeft:"20vh",backgroundColor:"white"}} >
       
      </div>               
       
       <div className= "col"></div>
       
        </div></div>



      )
  }  
}
const ImgDiv={
  backgroundImage: 'url('+image3+')',
  backgroundSize: "cover",
